import React from 'react';
import CampImage from './part/CampImage';
import CampCategory from './part/CampCategory';
import CampTitle from './part/CampTitle';

const CampaignFeature = () => {
    return (
        <div className='flex items-center w-full gap-x-8 max-w-[1048px]'>
            <CampImage className='h-[266px] flex-1'></CampImage>
            <div className="flex-1 max-w-[435px]">
               <CampCategory text="Architecture" className="mb-4 text-sm"></CampCategory>
               <CampTitle className='mb-4 text-xl font-bold'> Remake - We Make architecture exhibition</CampTitle>

            </div>
        </div>
    );
};

export default CampaignFeature;
